//Проверка документа на полное заполнение
function notValid(currentDocument) { 
    let resultValidate = currentDocument.validate();
 
    if (!currentDocument.getRows().size()){
        resultValidate.addValueError('Не заполнена табличная часть документа.');
    }

    if (resultValidate.hasErrors() || resultValidate.hasValueErrors() ) 
        return  resultValidate;
}

//Проведение документа
function activate(currentDocument) {
    let docForScriptExt = new DocumentForScriptExtention(currentDocument);
    if (!docForScriptExt.isValid()) {
        return docForScriptExt.validator.validationResult;
    }

    docForScriptExt.table.forEach((tableRec, i) => {
        let posting = EntityFactory.createPosting();
        posting.setComment('Учёт ПКО по скрипту');
        posting.setValue(tableRec.SummaBezNDS);
        posting.setDebit(tableRec.Debet);
        posting.setCredit(tableRec.Kredit);
        currentDocument.addPosting(posting);        
    });

    currentDocument.setExecuted();
    currentDocument.save();      
}

function deactivate(currentDocument) {
    currentDocument.unPostingAndSave();
}

class TableRecWrapper{
    constructor(tableRec, docMnemo){
        this._tableRec = tableRec;
        this._mnemo = `${docMnemo}.tr`;       
        //добавляем в обертку удобный способ доступа к полям таблицы
        tableRec.entrySet()
            .forEach(requisite => {
                let requisiteName = requisite.getKey().replace(this._mnemo + ".", "");
                this[requisiteName] = requisite.getValue(); 
            });                                             
    }
    
    get rec(){
        return this._tableRec;
    }
}

class DocumentForScriptExtention{
    constructor(document){
        this._document = document;
        this._table = new Array();
        this._validator = new DefaultDocumentValidator();
        document.getRows()
            .forEach((item) => { 
                let recWraper = new TableRecWrapper(item, document.getMnemo());
                this._table.push(recWraper);
            });
    }
    
    get table() {
        return this._table;
    }
    
    get validator(){
        return this._validator;
    }
    
    get originalDocument(){
        return this._document;
    }
    
    isValid(validator = this._validator){
        return validator.validate(this._document);
    }
}

class DefaultDocumentValidator{
    validationResult;
    constructor() {}    
    
    validate(currentDocument) {  
        this.validationResult = currentDocument.validate();
        if (!currentDocument.getRows().size()){        
            this.validationResult.addValueError('Не заполнена табличная часть документа.');
        }
        return !this.validationResult.hasErrors() && !this.validationResult.hasValueErrors(); 
    }
}
